import React from 'react';
import './Form.css'; // Import the shared CSS

const FawryPage = () => {
  return (
    <div className="form-container">
      <h2 className="form-title">Fawry Payment</h2>
      <form>
        <input type="text" className="form-input" placeholder="Fawry Account Number" />
        <input type="text" className="form-input" placeholder="Phone Number" />
        <input type="text" className="form-input" placeholder="Amount" />
        <button type="submit" className="form-btn">Submit Payment</button>
      </form>
    </div>
  );
};

export default FawryPage;
